import './App.css';
import Splash from './components/Splash';
import About from './components/About';
import MainWorks from './components/MainWorks';

function App() {
  return (
    <div className="App">
      <Splash />
      <About />
      <MainWorks title='Flower Magic' category='Game • Visual Novel • Unity' />

      <h1>React App</h1>
    </div>
  );
}

export default App;
